import React, { useState } from "react";
import { Paper, TextField, Button } from "@mui/material";

const ManualForm = () => {
  const [formValues, setFormValues] = useState({});

  // Handle changes to the form values
  const handleChange = (event) => {
    // Update the formValues state with the new value
    setFormValues({
      ...formValues,
      [event.target.name]: event.target.value,
    });
  };
  return (
    <Paper style={{ display: "flex", justifyContent: "center", padding: 20 }}>
      <div style={{ display: "flex", flexDirection: "column" }}>
        {/* Add a name attribute to each TextField component */}
        <TextField
          label="Company Name"
          variant="outlined"
          margin="normal"
          name="companyName"
          onChange={handleChange}
        />
        <TextField
          label="Interview Position"
          variant="outlined"
          margin="normal"
          name="interviewPosition"
          onChange={handleChange}
        />
        <TextField
          label="Company Values"
          variant="outlined"
          margin="normal"
          name="companyValues"
          onChange={handleChange}
        />
        <Button variant="contained" color="primary">
          Submit
        </Button>
      </div>
    </Paper>
  );
};

export default ManualForm;
